import React, { Component } from "react";
import { connect } from "react-redux";
import { BrowserRouter as Router } from "react-router-dom";

// components
import Menu from "./menu/menu";
import Menuclient from "../client/Menu/menuclient";
import Salonssearch from "./saloncontainer/saloncontainer";
import Saloninvits from "./salonssection/hairsalon";
import Login from "../login/loginclient";
import Footer from "../footer/footer";
import Signupclient from "../signup/signupclient";
import Signupprof from "../signup/signupprof";
import Caroselsalons from "../carosel/carosel_salons";
import Indexclient from "../client/indexclient";
import "../css/index.css";

export class Index extends Component {
  render() {
    return (
      <Router>
        <Menuclient />
        <Indexclient />

        <Footer />
      </Router>
    );
  }
}

const mapStateToProps = (state) => ({});

const mapDispatchToProps = {};

export default connect(mapStateToProps, mapDispatchToProps)(Index);

